const action = {
  updateValue: (data) => {
    return {
      type: "updateValue",
      payload: data,
    };
  },
  uploadImage: (data) => {
    return {
      type: "uploadImage",
      payload: data,
    };
  },
  storeUserInfoAsync:(data) => {
    return {
      type: "storeUserInfo",
      payload: data
    }
  },
  storeUserInfo:(data) => {
    return dispatch =>{
      setTimeout(()=>{
        dispatch(()=>{
          return {
            type: "storeUserInfo",
            payload: data,
          };
        });
      },5000)
    }
  }
};

export default action;
